import React from 'react'
import Contentcart from './ContentCart.Js'
function Cart (props) {

    return (
        <div>
            <button onClick={props.overPanier ? false : true}>Panier</button>
            {props.overPanier && <ContentCart shoppingContentCart={props.shoppingContentCart} />}
        </div>
    )
}

export default Cart
